import React from "react";
import ReactDOM from "react-dom";
import { Provider } from "react-redux";
import { createStore, applyMiddleware, compose } from "redux";
import thunk from "redux-thunk";
import NearbyHotelsPage from "./NearbyHotelsPage";
import PostFeed from "./PostFeed";
import { reducers } from "./reducers";
import App from "./App";
import "./index.css";

const store = createStore(reducers, compose(applyMiddleware(thunk)));
const dummyPosts = [
  {
    id: 1,
    user: "John Doe",
    content: "Exploring beautiful beaches in Bali!",
    imageUrl: "https://example.com/beach-image.jpg",
  },
  {
    id: 2,
    user: "Jane Smith",
    content: "Hiking in the Swiss Alps. Amazing views!",
    imageUrl: "https://example.com/mountain-image.jpg",
  },
  {
    id: 3,
    user: "Alice Johnson",
    content: "Safari adventure in Africa. Saw the Big Five!",
    imageUrl: "https://example.com/safari-image.jpg",
  },
  {
    id: 4,
    user: "Bob Williams",
    content: "Cityscape of Tokyo, Japan. Love the neon lights!",
    imageUrl: "https://example.com/tokyo-image.jpg",
  },
  {
    id: 5,
    user: "Eva Brown",
    content: "Camping under the stars in the Grand Canyon.",
    imageUrl: "https://example.com/grand-canyon-image.jpg",
  },
  {
    id: 6,
    user: "Michael Lee",
    content: "Skiing in the French Alps. Fresh powder all day!",
    imageUrl: "https://example.com/skiing-image.jpg",
  },
];

ReactDOM.render(
  <Provider store={store}>
    <App />
    <NearbyHotelsPage />
    <PostFeed posts={dummyPosts} />
  </Provider>,
  document.getElementById("root")
);
